import React from 'react';

function Profile() {
  return (
    <section className='auth'>
      <Logo />
      <h3 className='auth__title'>{title}</h3>
      <form
        className='auth__form'
        name={formName}
        noValidate
        autoComplete='off'>
        {children}
        <button
          className={`auth__button`}
          type='submit'>
          {buttonText}
        </button>
      </form>
      <button
        className='header__logout'
        onClick={onSignOut}>
        Выйти
      </button>
    </section>
  );
}

export default Profile;
